// src/components/Home.js
import React from 'react';
import { useNavigate } from 'react-router-dom';

const Home = () => {
    const navigate = useNavigate();

    const handleClick = () => {
        // Rediriger vers la page des appartements
        navigate('/appartements');
    };

    return (
        <div>
            <h1>Trouvez un logement !</h1>
            <div onClick={handleClick} style={{ cursor: 'pointer' }}>
                <img src="url_de_l_image_montpellier" alt="Montpellier" style={{ width: '200px', height: '150px' }} />
                <p>Montpellier</p>
            </div>
        </div>
    );
};

export default Home;
